defaults_vcl_backend.value:
backend test-backend {
           .connect_timeout = 5s;
           .dynamic = true;
           .first_byte_timeout = 20s;
           .between_bytes_timeout = 20s;
           .max_connections = 1000;
           .port = "443";
           .host = "test-host";

           .ssl = true;

           .ssl_cert_hostname = "test-host";

           .ssl_check_cert = always;
           .probe = {
               .request = "HEAD ${healthcheck_path} HTTP/1.1" "Connection: close";
               .window = 2;
               .threshold = 1;
               .timeout = 5s;
               .initial = 1;
               .interval = 60s;
               .dummy = true;
           }
       }

